en_nl.in:
Beste heer Cook,

Graag bevestigen wij uw afspraak bij Tesla Den Haag.
U heeft een afspraak waar u niet op kunt wachten en geen vervangende auto is inbegrepen.
Ondanks de huidige maatregelen van de overheid kan uw service-afspraak bij Tesla Den Haag doorgaan, maar wel met gepaste maatregelen op advies van het RIVM.

Huidige maatregelen:

- Draag een mondkapje, dit is WETTELIJK VERPLICHT; zonder mondkapje mogen wij u GEEN toegang verlenen tot onze Service Center;
- Onze lounge is geopend voor maximaal 2 personen;
- Desinfecteer uw handen bij binnenkomst;
- Kom alleen;
- Proefritten voor geluiden en trillingen voeren wij zonder klanten uit.
(1/2)

