nl_en.out:
Dear Mr Cook,

We are happy to confirm your appointment at Tesla The Hague.
You have an appointment that you cannot wait for and no replacement car is included.
Despite the current measures taken by the government, your service appointment at Tesla The Hague can continue, but with appropriate measures on the advice of the RIVM.

Current measures:

- Wear a mouth mask, this is LEGALLY REQUIRED; without a mouth mask, we are NOT allowed to grant you access to our Service Center;
- Our lounge is open for a maximum of 2 people;
- Disinfect your hands upon entry;
- Come alone;
- We carry out test drives for noise and vibrations without customers.
(1/2)
